
let restaurants=[];function Restaurant(place,user){this.place=place;this.user=user;}
function parseSubmissions(tsv){tsv=tsv.substring(1,tsv.length-1);tsv=tsv.replace(/(?:\\[r]+)/g,'');tsv=tsv.replace(/(?:\\[t]+)/g,'\t');tsv=tsv.replace(/(?:\\[n]+)/g,'\n');let submissions=Papa.parse(tsv);console.log('Parsed submissions:\n');console.log(submissions);submissions=submissions.data;for(let i=1;i<submissions.length;i++){[,email,submittedRestaurants]=submissions[i];preferredPlaces=Papa.parse(submittedRestaurants).data;preferredPlaces=preferredPlaces[0];for(let j=0;j<preferredPlaces.length;j++){restaurant=new Restaurant(preferredPlaces[j],email);restaurants.push(restaurant);}
console.log(`Parsed input from user ${email}`);}
restaurants=knuthShuffle(restaurants);console.log('Shuffled restaurants:');console.log(restaurants);}